				name="SoundCloud URL Input"
				placeholder="Enter SoundCloud URL..."
			/>
			<button className="Hammer-Button" type="button" onClick={submitSong}>
				HAMMER
			</button>
		</div>
	);
}

// Define function for action upon press
function submitSong() {
	console.log("Hello World");
}
